import { Container, Typography } from "@mui/material";
import React from "react";

const EverythingYouNeed = () => {
  return (
    <div>
      <Container>
        <Typography
          color="#00B0EF"
          fontSize={38}
          fontWeight="700"
          width={"60%"}
        >
          Everything you need to know about COVID-19 Vaccination Across the
          state
        </Typography>
      </Container>
    </div>
  );
};

export default EverythingYouNeed;
